import React from 'react';
import { Container, Row, Col } from "react-bootstrap";

const ESOutreach = () => {
  return (
    <div>
    <Container>
      <Row>
        <Col>
          <h2>Elementary Outreach</h2>
          <p>Content goes here</p>
          </Col>
      </Row>
    </Container>
  </div>
  );
};

export default ESOutreach;
